'''Ye olde Tea Shoppe''' is a [[Tea stall]] located in south-eastern [[Varrock]], next to the city wall. The shop is owned by the [[tea seller]]. The player can either buy [[Cup of tea|tea]] from the shop or steal it with a [[Thieving]] level of 5, granting 16 [[experience]]. It takes roughly four seconds for the stall to reset and one second to steal. Without the need to empty one's inventory, one could gain up to 11,520 Thieving experience per hour, but as it takes about 20 seconds to run to bank and return, the maximum experience per hour is around 10,000.

There is a cup of tea on the bench nearby, but it cannot be taken because it is apparently just for display.

Interestingly, if another cup of tea is placed on the table (via 'use' tea option on the table), no matter how many there are, the shop keeper will not allow them to be retrieved. They also appear to last much longer than the normal drop time, being able to last more than five minutes before disappearing.

Also, immediately after thieving tea, if the stall owner is talked to, he will call out the typical "Guards, Guards!" as with all stalls, but because the guards are too far away, they will not respond. Therefore, much experience can be gained without the usual consequential damage being done. If you stand directly across the covered tea stall from the shop owner, you can steal the tea pot over and over without being caught, giving you a cup of tea every time. This is particularly useful for lower levels or those new to [[Thieving training|training Thieving]].

